INSERT INTO `recipe` VALUES (1,'이 남자의 cook','4:16',98499,'제육볶음','{\"title\":\"제육볶음\",\"cooking_info\":{\"cooking_time\":\"30\",\"kcal\":600},\"ingredients\":[{\"name\":\"돼지고기 목살\",\"quantity\":\"600g\"},{\"name\":\"양조간장\",\"quantity\":\"3스푼(30g)\"},{\"name\":\"설탕\",\"quantity\":\"1.5스푼(22g)\"},{\"name\":\"후추가루\",\"quantity\":\"1/2작은스푼\"},{\"name\":\"고추장\",\"quantity\":\"4스푼(100g)\"},{\"name\":\"고춧가루\",\"quantity\":\"3스푼(21g)\"},{\"name\":\"물엿\",\"quantity\":\"2스푼(30g)\"},{\"name\":\"다진 마늘\",\"quantity\":\"2스푼(44g)\"},{\"name\":\"맛술(미림)\",\"quantity\":\"5스푼(50g)\"},{\"name\":\"들기름\",\"quantity\":\"1스푼(4g)\"},{\"name\":\"신김치(묵은지)\",\"quantity\":\"200g\"},{\"name\":\"양파\",\"quantity\":\"1/2개\"},{\"name\":\"대파\",\"quantity\":\"적당량\"},{\"name\":\"청양고추\",\"quantity\":\"2개\"},{\"name\":\"통깨\",\"quantity\":\"약간\"}],\"cooking_tips\":[\"고기를 양념에 재울 때 설탕을 먼저 넣어 고기 입자에 간이 잘 배게 합니다.\",\"김치를 물에 살짝 헹구어 사용하면 너무 짜지 않게 조리할 수 있습니다.\"],\"cooking_sequence\":{\"재료 손질\":{\"sequence\":[\"돼지고기는 5~6cm 크기로 얇게 썰어 준비합니다.\",\"양파는 채 썰고, 대파와 청양고추는 어슷하게 썰어 준비합니다.\",\"김치는 물에 가볍게 헹군 후 돼지고기와 비슷한 크기로 자릅니다.\"],\"timestamp\":0,\"timer\":0},\"고기 양념\":{\"sequence\":[\"돼지고기에 양조간장, 설탕, 후추가루를 넣고 섞은 후 30분간 재워둡니다.\"],\"timestamp\":41,\"timer\":0},\"양념장 준비\":{\"sequence\":[\"고추장, 고춧가루, 물엿, 다진 마늘, 맛술을 섞어 양념장을 만듭니다.\"],\"timestamp\":54,\"timer\":0},\"김치 볶기\":{\"sequence\":[\"팬에 들기름을 두르고 중불에서 김치를 볶습니다.\"],\"timestamp\":162,\"timer\":0},\"고기 볶기\":{\"sequence\":[\"김치를 한쪽으로 밀어두고 돼지고기를 볶습니다.\"],\"timestamp\":176,\"timer\":0},\"고기와 김치 함께 볶기\":{\"sequence\":[\"돼지고기와 김치를 함께 볶습니다.\"],\"timestamp\":189,\"timer\":0},\"양념장 추가\":{\"sequence\":[\"양념장을 넣고 2~3분간 볶습니다.\"],\"timestamp\":200,\"timer\":0},\"야채 추가\":{\"sequence\":[\"준비한 야채를 모두 넣고 2분간 볶습니다.\"],\"timestamp\":216,\"timer\":0},\"완성 및 서빙\":{\"sequence\":[\"완성된 제육볶음을 그릇에 담고 통깨를 뿌려 서빙합니다.\"],\"timestamp\":230,\"timer\":0}}}','[제육볶음] 이 영상을 본다면 앞으로 당신의 대표요리는 \'제육볶음\' / 돼지고기요리, 두루치기 stir-fried spicy pork',8570371,'https://www.youtube.com/watch?v=chnArCaEpqA',_binary ''),(2,'백종원 PAIK JONG WON','10:04',80988,'제육볶음','{\"title\":\"대파제육볶음\",\"cooking_info\":{\"cooking_time\":\"30\",\"kcal\":600},\"ingredients\":[{\"name\":\"삼겹살\",\"quantity\":\"300g\"},{\"name\":\"통마늘\",\"quantity\":\"8알(50g)\"},{\"name\":\"청양고추\",\"quantity\":\"3개(20g)\"},{\"name\":\"대파\",\"quantity\":\"2대(200g)\"},{\"name\":\"물\",\"quantity\":\"1/3컵(60g)\"},{\"name\":\"진간장\",\"quantity\":\"3큰술(30g)\"},{\"name\":\"설탕\",\"quantity\":\"1.5큰술(15g)\"},{\"name\":\"굵은 고춧가루\",\"quantity\":\"1큰술(5g)\"},{\"name\":\"고운 고춧가루\",\"quantity\":\"1큰술(5g)\"},{\"name\":\"참기름\",\"quantity\":\"1/2큰술(4g)\"},{\"name\":\"맛소금\",\"quantity\":\"적당량\"},{\"name\":\"후춧가루\",\"quantity\":\"적당량\"},{\"name\":\"깨소금\",\"quantity\":\"적당량\"}],\"cooking_tips\":[\"설탕을 먼저 넣어 고기 입자에 간이 잘 배게 합니다.\",\"간장을 팬 주위에 뿌려 불향을 내줍니다.\"],\"cooking_sequence\":{\"재료 손질\":{\"sequence\":[\"대파를 반 갈라 5cm 길이로 썰고, 청양고추는 두껍게 어슷하게 썰어줍니다.\",\"마늘은 두껍게 편 썰고, 삼겹살은 한입 크기로 잘라줍니다.\"],\"timestamp\":0,\"timer\":0},\"삼겹살 굽기\":{\"sequence\":[\"팬에 삼겹살을 올리고 맛소금과 후춧가루를 뿌려 중약 불로 구워줍니다.\",\"삼겹살이 노릇하게 익으면 마늘을 넣고 구워줍니다.\"],\"timestamp\":203,\"timer\":0},\"기름 제거\":{\"sequence\":[\"굽는 과정에 삼겹살에서 기름이 많이 나왔을 경우 적당히 덜어 빼줍니다.\"],\"timestamp\":324,\"timer\":0},\"설탕과 간장 추가\":{\"sequence\":[\"마늘이 노릇하게 구워지면 설탕을 넣어 볶아줍니다.\",\"간장을 팬 주위에 뿌려 누르듯이 볶아주어 불향을 내줍니다.\"],\"timestamp\":340,\"timer\":0},\"야채와 고춧가루 추가\":{\"sequence\":[\"손질한 대파를 넣고, 굵은 고춧가루, 고운 고춧가루를 넣어 볶아줍니다.\"],\"timestamp\":395,\"timer\":0},\"물 추가 및 마무리\":{\"sequence\":[\"양념이 겉돌지 않게 물을 넣어주어 볶아줍니다.\",\"파의 숨이 죽기 전에 후춧가루, 참기름 넣고 섞어줍니다.\",\"접시에 담아 깨소금을 뿌려 완성합니다.\"],\"timestamp\":418,\"timer\":0}}}','대파 듬뿍! 삼겹살로 만든 \'대파 제육볶음\'',9247461,'https://www.youtube.com/watch?v=j7s9VRsrm9o',_binary ''),(3,'쿡피아 Cookpia','8:49',22730,'제육볶음',NULL,'둘둘볶는 제육볶음. 비율만 기억하면 실패가 두렵지 않아요~[재업로드]',1931750,'https://www.youtube.com/watch?v=BzxJM4QdiB0',_binary ''),(4,'이종임 스타일 채널','9:49',4900,'제육볶음',NULL,'(Click CC for ENG sub) EP70-제육볶음) 쌈 싸먹으면 밥 한그릇 뚝딱! 밥도둑 제육볶음! Jeyuk Stir-fry',267277,'https://www.youtube.com/watch?v=NwxwtHIVEms',_binary 